import { useState } from 'react'
import './App.css';
import Create from './Component/Create'
import List from './Component/List'
import Navbar from './Component/Navbar'
import Search from './Component/Search'
import { v4 as id } from 'uuid'
function App() {
  const [ movies , setMovies] = useState([
    {name: "Avatar" , rating: 980 , fame: true , id: id() , like: true},
    { name: "Avatar", rating: 990, fame: true, id: id(), like: true },
    { name: "Avatar", rating: 980, fame: false, id: id(), like:  false },
    { name: "Avatar", rating: 980, fame: false, id: id(), like: false },
    { name: "Avatar", rating: 980, fame: false, id: id(), like: false }
  ])
  return (
    <div className="App">
      <Navbar/>
      <Search/>
      <Create/>
      <List/>
    </div>
  );
}

export default App;
